import style from "./Courses.module.css";
import React from "react";
import { useState } from "react";

import CourseTitle from "./SubComponents/CourseTitle";

function CoursesCreate(props) {
  //const [courseName, setCourseName] = useState("");
  //const [stepTitle, setStepTitle] = useState("");

  if (props.state.courses.courses.length === 0) {
    return (
      <div className={style.container}>
        <div>Courses page is empty</div>
        <div className={style.courseCreator}>
          <CourseTitle />
        </div>
        <dib>
          {props.array.map((p) => (
            <div key={p.id}>
              <Step />
            </div>
          ))}
        </dib>

        <button onClick={this.props.change}>Add Step</button>
      </div>
    );
  }
  return (
    <div className={style.container}>
      <div>
        {props.state.courses.courses.map((p) => (
          <div key={p.id}> </div>
        ))}
      </div>
    </div>
  );
}
export default CoursesCreate;
